import React from "react";

function Home() {
    return (
        <div>
            <h1>Hi, <br/>I'm Levent <br /> Software Engineer</h1>
            {/* Route Definitions */}
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/skills" element={<Skills />} />
            <Route path="/about" element={<About />} />
            <Route path="/experience" element={<Experience/>} />
        </Routes>
        </div>
    )
}
export default Home;
